  padding: 20px 15px 30px;
  background-color: #a0adbd;
}
.teamMember .pic {
  background-color: #4f6b92;
  padding: 10px;
  margin-bottom: 25px;
  transition: all 0.5s ease 0s;
}
.teamMember:hover .pic {
  background: #405777;
  border-radius: 50%;
}
.pic img {
  height: auto;
  border-radius: 50%;
}
.teamMember .name {
  font-weight: 600;
  color: #2e282a;
  text-transform: uppercase;
